import axios from "axios";
import { useState,useEffect }  from "react";
import { Link,useNavigate} from "react-router-dom";
const URI = "http://localhost:8080/cliente/"
const MostrarCliente = () => {
    const navigate = useNavigate();
    const [clientes, setClientes] = useState([])
    useEffect(() =>{
        getClientes()
    })

    const getClientes = async () =>{
        try {
            const res = await axios({
                method : "GET",
                url : URI + "list"
            });
            setClientes(res.data)
            //console.log(clientes)
        }
        catch (error) {
            
        }
    }
    return(
        <div className='container'>
            <div className='row'>
                <div className='col'>
                    <Link to="/create" className='btn btn-primary mt-2 mb-2'><i className="fas fa-plus"></i></Link>
                    <table className='table'>
                        <thead className='table-primary'>
                            <tr>
                                <th>Id</th>
                                <th>Nombre</th>
                                <th>Clave</th>
                            </tr>
                        </thead>
                        <tbody>
                            { clientes.map ( (cliente) => (
                                <tr key={ cliente.id_cliente}>
                                    <td> { cliente.nombre_cliente } </td>
                                    <td> { cliente.clave_cliente } </td>
                                    <td>
                                        <Link to={`/edit/${cliente.id_cliente}`} className='btn btn-info'><i className="fas fa-edit"></i></Link>
                                        <button  className='btn btn-danger'><i className="fas fa-trash-alt"></i></button>
                                    </td>
                                </tr>
                            )) }
                        </tbody>
                    </table>
                </div>    
            </div>
        </div>
    );
};

export default MostrarCliente;
